  return (
    <div className="dashboard">
        <div className="date-picker-place">
            <Row>
              <Col span={8} className="col-date-picker-place">
                From Date to Date: 
                <RangePicker onChange={onChangeRangePicker} format="DD-MM-YYYY"/>
              </Col>
              <Col span={8} className="col-date-picker-place">

              </Col>
              <Col span={8} className="col-date-picker-place">3</Col>
            </Row>
        </div>
    </div>
  );
}
